<p style="text-align: center;font-size:30px"><u><strong>PRIVACY POLICY</strong></u></p>

  <br>
 
  <p style="text-align: justify;">inpackaging and its mobile application platform (each referred to as a "Platform")
      are platforms that enable users (hereinafter referred to as "User" or "you" or "your")
      to directly communicate with one another through direct messaging or through the mobile application itself without
      any help from inpackaging. inpackaging understands the value of maintaining the confidentiality of personal information as
      well as the value of privacy. This Privacy Policy ("Privacy Policy") describes how inpackaging may gather,
      use, and disclose information relating to Users of the Platform and is applicable to all products and services
      offered by inpackaging. User may use inpackaging's services and products via a mobile device either through mobile
      applications or mobile optimized websites. This Privacy Policy also applies to such use of inpackaging’s services
      and products.</p>
  <p style="text-align: justify;">The definitions given to all capitalized terms in the Terms of Use of the Platform,
      which are available here, shall apply to all terms not otherwise defined in this document. inpackaging Technovations
      Private Limited (hereinafter referred to as "inpackaging" or "us" or "our") will be the
      contracting party.</p>
 
 
  <br>
  <ol class="number" start="1">
      <li>
          <p><strong>INFORMATION COLLECTION</strong></p>
          <ol class="small-text">
              <li>
                  <p style="text-align: justify;">inpackaging values User(s) privacy and has taken precautions to ensure that
                      inpackaging does not gather more data from Users than is required for inpackaging to deliver User(s) with
                      inpackaging's services and to safeguard User(s) account. Information including, but not limited to,
                      username, address, phone number, fax number, email address, gender, date and/or year of birth and
                      user preferences ("Registration Information") may be collected at the time of User
                      registration on the Platform.</p>
              </li>
              <li>
                  <p style="text-align: justify;">Information, such as but not limited to bank account numbers, billing
                      and delivery information, credit/debit card numbers and expiration dates, and tracking information
                      from checks or money orders ("Account Information"), may be gathered in connection with
                      any communication, transaction, and payment services, or any other services, that you may utilize
                      the Platform in order to facilitate the sale and purchase as well as the settlement of purchase
                      price.</p>
              </li>
              <li>
                  <p style="text-align: justify;">inpackaging keeps track of all User activity on the Platform in detail. As
                      and when communication and/or transactions are made through the Platform, information pertaining to
                      those communications and/or transactions, including but not limited to "Activities
                      Information," may be gathered, including but not limited to the types and specifications of the
                      goods, pricing and delivery information, dispute records, and any information disclosed in any
                      communication forum made available by us and/or other inpackaging affiliated companies.</p>
              </li>
              <li>
                  <p style="text-align: justify;">d. inpackaging keeps track of users' online browsing and shopping
                      activities, including but not limited to IP addresses, browsing habits, and user behaviour.
                      Additionally, we collect statistical data about the Platform and users of the Platform, such as IP
                      addresses, browser versions, operating systems, software and hardware characteristics, pages viewed,
                      session length, and unique users (collectively, "Browsing Information").</p>
              </li>
              <li>
                  <p style="text-align: justify;">User Data refers to the combined categories of registration information,
                      account information, activities information, and browsing information.</p>
              </li>
              <li>
                  <p style="text-align: justify;">Certain categories of User Data (as specified at the time of collection)
                      must be provided by Users of the Platform. inpackaging might not be able to finish the registration
                      process or offer such Users inpackaging's products or services if Users fail to provide any or
                      enough User Data that is marked as necessary.</p>
              </li>
          </ol>
      </li>
  </ol>
 
 
  <br>
  <ol class="number" start="2">
      <li>
          <!-- <ol start="2">
      <li> -->
          <p><strong>UTILISATION OF USER DATA</strong></p>
          <p>inpackaging will be deemed to have your consent to collect, store, and use your User Data for the following
              purposes if you provide it to us:</p>
 
          <ol class="small-text">
              <li>
                  <p>User identity verification;</p>
              </li>
              <li>
                  <p>processing User's user registration, giving User a Platform log-in ID, and managing and keeping
                      up with User's registration;</p>
              </li>
              <li>
                  <p>offering customer service to users and responding to their questions, comments, claims, or
                      disagreements;</p>
              </li>
              <li>
                  <p>to make it easier for Users to communicate on the platform and/or process their transactions there;
                  </p>
              </li>
              <li>
                  <p style="text-align: justify;">conducting research or statistical analysis to enhance the
                      Platform's content and design, inpackaging's product and service offerings, and for marketing
                      and promotional purposes.;</p>
              </li>
              <li>
                  <p style="text-align: justify;">In accordance with applicable laws, inpackaging (along with our affiliated
                      companies and their designated Service Providers) may use a user's name, phone number,
                      residential address, email address, fax number, and other information (collectively, "Marketing
                      Data") to send notices, surveys, product alerts, communications, and other marketing materials
                      to a user(s) regarding goods and services provided by inpackaging or inpackaging's affiliated
                      companies.;</p>
              </li>
              <li>
                  <p style="text-align: justify;">Users are deemed to have given consent for the publication of such
                      information on the Platform if they voluntarily submit any User information or other information to
                      the Platform for publication on the Platform through the publishing tools; and</p>
              </li>
              <li>
                  <p style="text-align: justify;">Making any disclosures necessary for any of the aforementioned purposes,
                      as mandated by law, regulations, and guidelines, or in connection with any inquiries, complaints, or
                      potential complaints made against us or against third parties.&nbsp;</p>
              </li>
          </ol>
      </li>
  </ol>
 
 
  <br>
  <ol class="number" start="3">
      <li>
          <p><strong>TRANSMISSION OF USER DATA</strong></p>
      </li>
 
      <!-- <li start="3">
          <p><strong>TRANSMISSION OF USER DATA</strong></p></li> -->
      <ol class="small-text">
          <li>
              <p style="text-align: justify;">The user also consents to inpackaging disclosing and transferring User Data to
                  third-party service providers ("Service Providers"), including but not limited to those who
                  provide data entry, database management, promotions, product and service alerts, delivery services,
                  payment extension services, authentication and verification services, and logistics services. inpackaging is
                  required to maintain their confidentiality, and these Service Providers are only allowed to use User
                  Data in connection with the activities listed in clause 2 above.</p>
          </li>
          <li>
              <p style="text-align: justify;">User(s) consent to inpackaging disclosing and transferring User Data to its
                  affiliated businesses and/or those of their chosen service providers.</p>
          </li>
          <li>
              <p style="text-align: justify;">inpackaging may, as needed, also transfer and disclose User Data to our
                  professional advisers, law enforcement officials, insurance companies, governmental and regulatory
                  bodies, and other organizations.</p>
          </li>
          <li>
              <p style="text-align: justify;">inpackaging will keep any User Data provided by Users and make it available to
                  our staff, any Service Providers inpackaging engages, and the third parties mentioned in clause 3 herein for
                  or in connection with any of the purposes listed in clause 2 above.</p>
          </li>
          <li>
              <p style="text-align: justify;">All voluntarily submitted information by you to the Platform, such as
                  product information, images, comments, and feedback, may be made public and thus accessible to anyone
                  with an internet connection. User waives all proprietary rights (including, but not limited to, rights
                  of confidentiality and copyright) in any voluntary information that User discloses to inpackaging and such
                  voluntary information becomes public information. When choosing to include personal or confidential
                  information in the voluntary information that User submits to inpackaging or uploads on the Platform, User
                  should use caution.</p>
          </li>
          <li>
              <p style="text-align: justify;">inpackaging may give third parties, such as banks, financial institutions,
                  credit bureaus, or vendors, access to User Data so they can market to Users with their goods or
                  services. While inpackaging will make an effort to put internal controls in place to protect User Data from
                  unauthorized access, there is no assurance that these measures or controls can completely eliminate the
                  risks of theft, loss, or misuse.</p>
          </li>
          <li>
              <p style="text-align: justify;">inpackaging may form partnerships with third parties and websites to provide
                  Users with access to goods and services that inpackaging does not currently provide. You might be given
                  access by inpackaging to these other parties' content or websites. The goods and services that these
                  third parties enable or facilitate are not covered by this privacy statement. inpackaging has no control
                  over the data that a user might give to those third parties, and their privacy policies may be different
                  from inpackaging's. Before responding to or utilizing any offers, products, or services advertised or
                  provided by those third parties, user should review the relevant privacy policy for those third
                  parties.&nbsp;</p>
          </li>
      </ol>
      
  </ol>
 
 
  <br>
  <ol class="number" start="4">
      <li>
          <p><strong>THE RIGHT TO CHANGE USER DATA</strong></p>
          <p>Users have the right, as permitted by applicable laws, to access personal information held by inpackaging and to
              ask for the information to be updated or corrected.</p>
      </li>
  </ol>
 
 
  <br>
  <ol class="number" start="5">
      <li>
          <p><strong>COOKIES</strong></p>
          <p style="text-align: justify;">inpackaging uses "cookies" to keep track of the User's visits to the
              Sites and to store specific information about the User. A "cookie" is a small file that is sent to
              a user's browser and saved on their computer or other device. If User does not disable or remove the
              cookie, our services will be notified every time User uses the same device to access the Platform, and
              inpackaging may then be aware of User visits and the User's usage patterns.</p>
          <p style="text-align: justify;">In general, inpackaging uses cookies to recognize Users and make it possible for
              inpackaging to: i) access Users' Registration Information or Account Information so Users don't have
              to re-enter it; ii) collect statistical data about Users' usage; iii) research visiting patterns and
              help target advertisements based on Users' interests; iv) help inpackaging's partners track
              Users' visits to the Platform and process orders; and v monitor progress and participation on the
              Platform.</p>
          <p style="text-align: justify;">The browser that is installed on the user's device can be configured to
              control whether and how cookies are accepted. User has the option to modify those configurations. If the
              user selects the cookie-disabling function and rejects all cookies, they might have to enter information on
              the platform more frequently and some features might not work.</p>
      </li>
  </ol>
 
 
  <br>
  <ol class="number" start="6">
